import React, { useState } from 'react';
import axios from './api/axios';

const Student = () => {
  const [newStudent, setNewStudent] = useState({
    id: '',
    name: '',
    major: '',
    year: '',
    class: '',
    gender: '',
    dateOfBirth: '',
    email: '',
    phone: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const addStudent = async () => {
    setError('');
    setSuccess('');

    if (
      newStudent.id &&
      newStudent.name &&
      newStudent.major &&
      newStudent.year &&
      newStudent.class &&
      newStudent.gender &&
      newStudent.dateOfBirth &&
      newStudent.email &&
      newStudent.phone
    ) {
      try {
        // Gửi dữ liệu đến backend
        const response = await axios.post('/students', newStudent);
        
        if (response.status >= 200 && response.status < 300) {
          setSuccess('Student added successfully!');
          setNewStudent({
            id: '',
            name: '',
            major: '',
            year: '',
            class: '',
            gender: '',
            dateOfBirth: '',
            email: '',
            phone: '',
          });
        } else {
          setError('Failed to add student. Please try again.');
        }
      } catch (err) {
        setError('An error occurred while adding the student.');
        console.error('Add student error:', err);
      }
    } else {
      setError('Please enter full information');
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Add Student</h2>
      {success && <p className="text-green-500 mb-4">{success}</p>}
      {error && <p className="text-red-500 mb-4">{error}</p>}
      <div className="grid grid-cols-2 gap-4 mb-6">
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Full Name</label>
          <input
            type="text"
            placeholder="Full name"
            value={newStudent.name}
            onChange={(e) => setNewStudent({ ...newStudent, name: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Student ID</label>
          <input
            type="text"
            placeholder="Student ID"
            value={newStudent.id}
            onChange={(e) => setNewStudent({ ...newStudent, id: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Choose Major</label>
          <select
            value={newStudent.major}
            onChange={(e) => setNewStudent({ ...newStudent, major: e.target.value })}
            className="w-full p-2 border rounded"
          >
            <option value="">Choose major</option>
            <option value="ICT">ICT - Information and Communication Technology</option>
            <option value="CS">CS - Cyber Security</option>
            <option value="DS">DS - Data Science</option>
          </select>
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Choose Academic Year</label>
          <select
            value={newStudent.year}
            onChange={(e) => setNewStudent({ ...newStudent, year: e.target.value })}
            className="w-full p-2 border rounded"
          >
            <option value="">Choose academic year</option>
            <option value="B0">B0</option>
            <option value="B1">B1</option>
            <option value="B2">B2</option>
            <option value="B3">B3</option>
          </select>
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Class</label>
          <input
            type="text"
            placeholder="Class"
            value={newStudent.class}
            onChange={(e) => setNewStudent({ ...newStudent, class: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Gender</label>
          <select
            value={newStudent.gender}
            onChange={(e) => setNewStudent({ ...newStudent, gender: e.target.value })}
            className="w-full p-2 border rounded"
          >
            <option value="">Choose gender</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
            <option value="Other">Other</option>
          </select>
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Date of Birth</label>
          <input
            type="date"
            value={newStudent.dateOfBirth}
            onChange={(e) => setNewStudent({ ...newStudent, dateOfBirth: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Email</label>
          <input
            type="email"
            placeholder="Email"
            value={newStudent.email}
            onChange={(e) => setNewStudent({ ...newStudent, email: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <div>
          <label className="block text-gray-700 font-semibold mb-2">Phone Number</label>
          <input
            type="tel"
            placeholder="Phone number"
            value={newStudent.phone}
            onChange={(e) => setNewStudent({ ...newStudent, phone: e.target.value })}
            className="w-full p-2 border rounded"
          />
        </div>
        <button
          onClick={addStudent}
          className="col-span-2 bg-green-500 text-white p-2 rounded hover:bg-green-600"
        >
          Add student
        </button>
      </div>
    </div>
  );
};

export default Student;
